import 'bootstrap/dist/css/bootstrap.min.css'
import PastOrders from './components/PastOrders';
import { getOrders } from './axios/Service';

const App = () => {

  const orders = getOrders(orders => {
    console.log(orders);
    return []
  })

  return (
    <div>
      <MainHeader></MainHeader>
      <main>
        <Route path="/past-orders">
          <PastOrders orders={orders}></PastOrders>
        </Route>
        <Route path="/present-orders">
          <ComponentB></ComponentB>
        </Route>
      </main>
    </div>
  )

};

export default App;
